import React from 'react';
import '../styles.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-container">
        <div className="footer-section">
        </div>
        <div className="footer-section">
          <h4>Contact Us</h4>
          <p>Email: support@jobportal.com</p>
          <p>Phone: +123 456 7890</p>
          <p>Address: 123 Job Portal Lane, Tech City, TX</p>
        </div>
        <div className="footer-section">
          <h4>Follow Us</h4>
          <div className="social-icons">
            <a href="https://facebook.com" target="_blank" rel="noopener noreferrer">
              <img src="data:image/jpeg;base64," alt="Facebook" />
            </a>
            <a href="https://twitter.com" target="_blank" rel="noopener noreferrer">
              <img src="data:image/png;base64," alt="Twitter" />
            </a>
            <a href="https://linkedin.com" target="_blank" rel="noopener noreferrer">
              <img src="data:image/png;base64," alt="LinkedIn" />
            </a>
            <a href="https://instagram.com" target="_blank" rel="noopener noreferrer">
              <img src="data:image/jpeg;base64," alt="Instagram" />
            </a>
          </div>
        </div>
      </div>
      <div className="footer-bottom">
        <p>&copy; 2024 Job Searching Portal. All rights reserved.</p>
      </div>
    </footer>
  );
};

export default Footer;
